import React from "react";

export default function Header(){
  return (
    <header style={{
      position:"sticky", top:0, zIndex:10, background:"#fff",
      borderBottom:"1px solid #eee"
    }}>
      <div className="container" style={{
        display:"flex", alignItems:"center", justifyContent:"space-between",
        height:72, gap:24
      }}>
        <a href="#top" style={{display:"flex", alignItems:"center", gap:12}}>
          {/* простая «вертушка» как логотип */}
          <div style={{
            width:34, height:34, borderRadius:"50%",
            background:"radial-gradient(circle at 30% 30%, #111 35%, transparent 36%), radial-gradient(circle at 70% 30%, #111 35%, transparent 36%), radial-gradient(circle at 50% 75%, #111 35%, transparent 36%)",
            position:"relative"
          }} aria-hidden />
          <strong style={{fontSize:20}}>Вентагрегат</strong>
        </a>
        <nav style={{display:"flex", gap:24, alignItems:"center", fontWeight:600}}>
          <a href="#prod">Продукция</a>
          <a href="#catalog">Прайс-листы</a>
          <a href="#contact">Контакты</a>
          <a href="tel:+71111111111" style={{display:"flex", gap:8, alignItems:"center"}}>
            ☎ <span>(111) 111-1111</span>
          </a>
        </nav>
      </div>
    </header>
  );
}
